import './App.css';

function App() {
  return (
    <div className="App">
      {/* The Head */}
      <h1>To Do List With React Hooks</h1>
      {/* The Input */}
      <input
        type='text'
        placeholder='Add an item...'
      />
      {/* Add Button */}
      <button>Add</button>
      {/* List of items */}
      <ul>
        <li>Read three pages</li>
        <li>Coding</li>
        <li>Find a football club</li>
      </ul>
    </div>
  );
}

export default App;
